        #error-message { color: #d90429; text-align: center; margin-top: 15px; font-weight: bold; display: none; }

                            <option value="E">E: Annuity for 20 years certain</option>
                            <option value="F">F: Annuity with return of purchase price</option>
                            <option value="G">G: Annuity increasing at 3% p.a.</option>

                        <optgroup label="Joint Life Options">
                            <option value="H">H: 50% annuity to survivor</option>
                            <option value="I">I: 100% annuity to survivor</option>
                            <option value="J">J: 100% to survivor + Return of Purchase Price</option>
                        </optgroup>
                    </select>
                </div>
            </div>
            <button type="submit">Calculate Annuity</button>

    document.addEventListener('DOMContentLoaded', () => {
        document.getElementById('option-type').addEventListener('change', toggleSecondAge);
        toggleSecondAge();
    });

    function toggleSecondAge() {
        const option = document.getElementById('option-type').value;
        const secondAgeGroup = document.getElementById('second-age-group');
        const secondAgeInput = document.getElementById('second-age');
        const jointLifeOptions = ['H', 'I', 'J'];
        secondAgeGroup.style.display = jointLifeOptions.includes(option) ? 'block' : 'none';
        secondAgeInput.required = jointLifeOptions.includes(option);
    }

    function formatCurrency(num) {
        return ` ${new Intl.NumberFormat('en-IN', { minimumFractionDigits: 0, maximumFractionDigits: 2 }).format(num)}`;
    }

    function showError(message) {
        const errorDiv = document.getElementById('error-message');
        errorDiv.textContent = message;
        errorDiv.style.display = 'block';
        document.getElementById('results').style.display = 'none';
    }

    function calculatePremium() {
    document.getElementById('results').style.display = 'none';
    document.getElementById('error-message').style.display = 'none';

    const primaryAge = parseInt(document.getElementById('primary-age').value);
    const secondAge = parseInt(document.getElementById('second-age').value);
    const purchasePrice = parseFloat(document.getElementById('purchase-price').value);
    const option = document.getElementById('option-type').value;

    const singleLifeOptions = ['A', 'B', 'C', 'D', 'E', 'F', 'G'];
    const jointLifeOptions = ['H', 'I', 'J'];

    // --- Input Validations ---
    if (isNaN(primaryAge) || isNaN(purchasePrice) || !option) {
        showError("Please fill all required fields.");
        return;
    }
    if (jointLifeOptions.includes(option) && (isNaN(secondAge) || secondAge < 25 || secondAge > 85)) {
        showError("Please enter a valid Second Annuitant's Age (25-85).");
        return;
    }
    if (purchasePrice < 100000) {
        showError("Minimum Purchase Price is  1,00,000.");
        return;
    }

    // --- HELPER FUNCTIONS BASED ON OFFICIAL DOCUMENTATION ---
    function getIncentiveRates(price) {
        if (price >= 10000000) return { yearly: 4.35, halfYearly: 4.25, quarterly: 4.20, monthly: 4.15 };
        if (price >= 2500000) return { yearly: 4.10, halfYearly: 4.00, quarterly: 3.95, monthly: 3.90 };
        if (price >= 1000000) return { yearly: 3.60, halfYearly: 3.50, quarterly: 3.45, monthly: 3.40 };
        if (price >= 500000) return { yearly: 2.50, halfYearly: 2.40, quarterly: 2.35, monthly: 2.30 };
        return { yearly: 0, halfYearly: 0, quarterly: 0, monthly: 0 };
    }
    
    // NOTE: This function is still here, but it is NOT being used in the Joint Life calculation below.
    function getReductionFactor(annualPension) {
        if (annualPension < 100000) return 5; 
        if (annualPension < 150000) return 2;
        return 0;
    }

    const incentiveRates = getIncentiveRates(purchasePrice);
    let finalYearlyPension = 0, finalHalfYearlyPension = 0, finalQuarterlyPension = 0, finalMonthlyPension = 0;

    // --- SINGLE LIFE BLOCK (UNTOUCHED AND WORKING PERFECTLY) ---
    if (singleLifeOptions.includes(option)) {
        const optionMap = { A: 1, B: 2, C: 3, D: 4, E: 5, F: 6, G: 7 };
        const term = optionMap[option];
        const rateData = annuityRates.find(r => r.age === primaryAge && r.term === term);
        if (!rateData) { showError("Annuity rates not found for the selected age and option."); return; }

        const totalYearlyRate = rateData.TbpY + incentiveRates.yearly;
        const totalHalfYearlyRate = rateData.TbpH + incentiveRates.halfYearly;
        const totalQuarterlyRate = rateData.TbpQ + incentiveRates.quarterly;
        const totalMonthlyRate = rateData.TbpM + incentiveRates.monthly;

        finalYearlyPension = Math.round(((purchasePrice / 1000) * totalYearlyRate) / 1);
        finalHalfYearlyPension = Math.round(((purchasePrice / 1000) * totalHalfYearlyRate) / 2);
        finalQuarterlyPension = Math.round(((purchasePrice / 1000) * totalQuarterlyRate) / 4);
        finalMonthlyPension = Math.round(((purchasePrice / 1000) * totalMonthlyRate) / 12);
        
    // --- JOINT LIFE BLOCK (USING YOUR WORKING CODE, BUT WITH REDUCTION REMOVED) ---
    } else if (jointLifeOptions.includes(option)) {
        
        function getJointLifeBaseRate(term) {
            const secondaryKey = `T${secondAge}`;
            const rateData = premiumRates.find(r => r.Age === primaryAge && r.Term === term);
            return (rateData && rateData.hasOwnProperty(secondaryKey)) ? rateData[secondaryKey] : null;
        }
        
        const optionBase = (option === 'H') ? 8 : (option === 'I') ? 9 : 10;
        
        const yearlyTerm = optionBase + 0.1;
        const halfYearlyTerm = optionBase + 0.2;
        const quarterlyTerm = optionBase + 0.4;
        const monthlyTerm = optionBase + 0.12;

        const baseYearlyRate = getJointLifeBaseRate(yearlyTerm);
        const baseHalfYearlyRate = getJointLifeBaseRate(halfYearlyTerm);
        const baseQuarterlyRate = getJointLifeBaseRate(quarterlyTerm);
        const baseMonthlyRate = getJointLifeBaseRate(monthlyTerm);
        
        if (baseYearlyRate === null || baseHalfYearlyRate === null || baseQuarterlyRate === null || baseMonthlyRate === null) {
            showError("Annuity rates not found for this Joint Life combination. Please check data table.");
            return;
        }

        // --- Calculate for each mode using ONLY the base rate and incentive rate ---
        
        // YEARLY
        let grossYearlyPension = (purchasePrice / 1000) * (baseYearlyRate + incentiveRates.yearly);
        finalYearlyPension = Math.round(grossYearlyPension);

        // HALF-YEARLY
        let grossHalfYearlyPension = (purchasePrice / 1000) * (baseHalfYearlyRate + incentiveRates.halfYearly);
        finalHalfYearlyPension = Math.round(grossHalfYearlyPension / 2);

        // QUARTERLY
        let grossQuarterlyPension = (purchasePrice / 1000) * (baseQuarterlyRate + incentiveRates.quarterly);
        finalQuarterlyPension = Math.round(grossQuarterlyPension / 4);

        // MONTHLY
        let grossMonthlyPension = (purchasePrice / 1000) * (baseMonthlyRate + incentiveRates.monthly);
        finalMonthlyPension = Math.round(grossMonthlyPension / 12);
    }

    // --- Display Results ---
    const premiumWithGST = purchasePrice * 1.018;
    document.getElementById('output-purchase-price').textContent = formatCurrency(purchasePrice);
    document.getElementById('output-single-premium').textContent = formatCurrency(premiumWithGST);
    
    document.getElementById('output-yearly').textContent = formatCurrency(finalYearlyPension);
    document.getElementById('output-half-yearly').textContent = formatCurrency(finalHalfYearlyPension);
    document.getElementById('output-quarterly').textContent = formatCurrency(finalQuarterlyPension);
    document.getElementById('output-monthly').textContent = formatCurrency(finalMonthlyPension);

    document.getElementById('results').style.display = 'block';
}
</script>

</body>
</html>
